import React, { Component } from "react";
import "./estilos.css";
import 'bootstrap/dist/css/bootstrap.min.css';

class Rodape extends Component{
    render(){
    
          return(
            <section>
                <h1>Fontes:</h1>
                <ul>
                    <li>
                        <span className='fonteNome'>IDH, Expectativa de vida (2019):</span>
                        <span className='fonteFonte'> http://hdr.undp.org/en/data</span>
                        
                    </li>
                </ul>
                           
                

            </section>
        )
    
    }
}

export default Rodape;
